import{r as a,o as r,c,a as p,b as t,F as n,d as o,e as s}from"./app.9aaa2256.js";import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";const d={},_=o('<h3 id="\u4E00\u4F4D\u4E2D\u5E74\u7537\u6027\u7684\u533B\u7F8E\u4F53\u9A8C\u62A5\u544A" tabindex="-1"><a class="header-anchor" href="#\u4E00\u4F4D\u4E2D\u5E74\u7537\u6027\u7684\u533B\u7F8E\u4F53\u9A8C\u62A5\u544A" aria-hidden="true">#</a> \u4E00\u4F4D\u4E2D\u5E74\u7537\u6027\u7684\u533B\u7F8E\u4F53\u9A8C\u62A5\u544A</h3><p>\u4F5C\u4E3A\u4E00\u4F4D\u4E2D\u5E74\u7537\u6027\uFF0C\u6211\u5176\u5B9E\u4E0D\u600E\u4E48\u5173\u5FC3\u81EA\u5DF1\u7684\u8138\uFF0C\u4F46\u81EA\u4ECE\u6021\u79BE\u65B0\u8BCA\u6240\u5F00\u4E86\u533B\u5B66\u7F8E\u5BB9\u79D1\uFF0C\u6211\u8FD9\u5F20\u8001\u8138\u5C31\u88AB\u8BCA\u6240\u7684\u533B\u751F\u4EEC\u60E6\u8BB0\u4E0A\u4E86\u3002</p><p>\u201C\u88F4\u533B\u751F\uFF0C\u4F60\u4E0D\u80FD\u8FD9\u6837\u653E\u5F03\u81EA\u5DF1\u554A\u3002\u201D</p><p>\u201C\u88F4\u533B\u751F\uFF0C\u4F60\u7684\u8001\u5E74\u6591\u53EF\u4EE5\u6765\u6253\u4E0B\u6FC0\u5149\uFF0C\u6548\u679C\u5E94\u8BE5\u4F1A\u4E0D\u9519\u7684\u3002\u201D</p><p>\u5C31\u8FDE\u90A3\u5929\u5317\u4EAC\u534F\u548C\u533B\u9662\u7684\u5B59\u79CB\u5B81\u8001\u5E08\u6765\u8BCA\u6240\u8BB2\u8BFE\uFF0C\u6211\u9732\u9762\u65F6\u6B63\u8BB2\u5230\u6CE8\u5C04\u7684\u5185\u5BB9\uFF0C\u5B59\u8001\u5E08\u770B\u5230\u6211\u7B2C\u4E00\u773C\u5C31\u8BF4\uFF1A\u88F4\u533B\u751F\u7684\u62AC\u5934\u7EB9\u3001\u9C7C\u5C3E\u7EB9\u5F88\u9002\u5408\u6253\u8089\u6BD2\u7D20\u548C\u73BB\u5C3F\u9178\u3002\u5C31\u5DEE\u88AB\u73B0\u573A\u62FF\u6765\u505A\u6253\u9488\u793A\u6559\u4E86\u3002</p><p>\u88AB\u4ED6\u4EEC\u8BF4\u591A\u4E86\uFF0C\u6211\u4E5F\u5F00\u59CB\u5FCD\u4E0D\u4F4F\u4F1A\u7167\u7167\u955C\u5B50\u53BB\u7AEF\u8BE6\u4E00\u4E0B\u81EA\u5DF1\uFF0C\u7136\u540E\u786E\u5B9E\u611F\u89C9\u6709\u4E9B\u770B\u4E0D\u4E0B\u53BB\uFF0C\u4E8E\u662F\u4E0A\u5468\u4E94\u7ED9\u81EA\u5DF1\u7EA6\u4E86\u4E2A\u95E8\u8BCA\uFF0C\u8BA9\u76AE\u80A4\u533B\u751F\u597D\u597D\u8BC4\u4F30\u7ED9\u70B9\u5EFA\u8BAE\u3002</p><p>\u9884\u7EA6\u7684\u662F\u5468\u7490\u533B\u751F\uFF0C\u5C31\u662F\u90A3\u4E2A\u53CD\u590D\u8BF4\u6211\u4E0D\u8981\u653E\u5F03\u81EA\u5DF1\u7684\u533B\u751F\uFF0C\u5979\u5B89\u6392\u6211\u5148\u505A\u4E2AVisia\u3002</p><p>Visia\u662F\u4E00\u79CD\u5229\u7528\u767D\u5149\u3001\u7D2B\u5916\u5149\u3001\u504F\u632F\u5149\u626B\u63CF\u76AE\u80A4\uFF0C\u7136\u540E\u4ECE\u8272\u6591\u3001\u76B1\u7EB9\u3001\u6BDB\u5B54\u3001\u5E73\u6574\u5EA6\u7B49\u89D2\u5EA6\u5BF9\u76AE\u80A4\u4F5C\u51FA\u5B9A\u91CF\u8BC4\u4F30\u7684\u4EEA\u5668\u3002</p><p>Visia\u8BC4\u4F30\u4E0B\u6765\uFF0C\u6211\u5728\u76B1\u7EB9\u3001\u6BDB\u5B54\u3001\u7D2B\u8D28\u8FD9\u4E09\u4E2A\u6307\u6807\u4E0A\u60E8\u4E0D\u5FCD\u7779\uFF0C\u8FDC\u4F4E\u4E8E\u540C\u9F84\u4EBA\uFF0C\u4E0D\u8FC7\u6700\u540E\u7EFC\u5408\u8BC4\u4F30\u6211\u7684\u76AE\u80A4\u5E74\u9F84\u5012\u548C\u6211\u7684\u771F\u5B9E\u5E74\u9F84\u662F\u4E00\u81F4\u7684\u3002</p><p>\u5468\u533B\u751F\u6839\u636E\u6211\u7684\u76AE\u80A4\u72B6\u51B5\u548C\u68C0\u6D4B\u7ED3\u679C\uFF0C\u8BA4\u4E3A\u6211\u7684\u76B1\u7EB9\u548C\u6BDB\u5B54\u95EE\u9898\u53EF\u4EE5\u505A\u4E2A\u5149\u5B50\u5AE9\u80A4\u6539\u5584\u4E00\u4E0B\uFF0C\u4F46\u76F8\u6BD4\u4E8E\u90A3\u4E9B\u95EE\u9898\uFF0C\u6211\u8138\u4E0A\u7684\u201C\u8001\u5E74\u6591\u201D\u66F4\u5E94\u8BE5\u5904\u7406\uFF0C\u56E0\u4E3A\u8FD8\u6BD4\u8F83\u660E\u663E\uFF0C\u5DF2\u7ECF\u5F71\u54CD\u5230\u4E86\u5916\u89C2\u3002</p><p>\u5468\u533B\u751F\u8BF4\uFF0C\u6211\u7684\u90A3\u51E0\u5757\u201C\u8001\u5E74\u6591\u201D\uFF0C\u5B9E\u9645\u662F\u65E5\u5149\u6027\u96C0\u6591\u6837\u75E3\uFF0C\u53EF\u4EE5\u505A\u7EA2\u5B9D\u77F3\u6FC0\u5149\u6CBB\u7597\uFF0C\u6FC0\u5149\u7684\u80FD\u91CF\u53EF\u4EE5\u9488\u5BF9\u6027\u7206\u7834\u9ED1\u8272\u7D20\u9897\u7C92\uFF0C\u7136\u540E\u88AB\u5438\u6536\uFF0C\u6548\u679C\u5E94\u8BE5\u4F1A\u6BD4\u8F83\u597D\uFF0C\u6211\u542C\u4ECE\u4E86\u5979\u7684\u5EFA\u8BAE\u51B3\u5B9A\u6CBB\u7597\u3002</p><p>\u5373\u4FBF\u81EA\u5DF1\u662F\u533B\u751F\uFF0C\u5373\u4FBF\u662F\u5728\u6211\u4EEC\u81EA\u5DF1\u7684\u8BCA\u6240\u5185\uFF0C\u505A\u6CA1\u63A5\u89E6\u8FC7\u7684\u6CBB\u7597\uFF0C\u5176\u5B9E\u8FD8\u662F\u6709\u70B9\u7D27\u5F20\uFF0C\u4E0D\u77E5\u9053\u4F1A\u4E0D\u4F1A\u75BC\uFF0C\u4F1A\u4E0D\u4F1A\u9EBB\u3002 \u5728\u6FC0\u5149\u6CBB\u7597\u5BA4\u8EBA\u4E0B\uFF0C\u88AB\u6234\u4E0A\u773C\u7F69\uFF0C\u6211\u6EE1\u8111\u5B50\u90FD\u662F\u79D1\u5E7B\u7247\u91CC\u90A3\u79CD biu\uFF5Ebiu\uFF5E\u54CD\u7684\u6FC0\u5149\u67AA\u4E86\uFF0C\u60F3\u8C61\u8FD9\u4E9B\u6FC0\u5149\u6253\u5728\u8138\u4E0A\u5192\u70DF\uFF0C\u4E0D\u7531\u5F97\u624B\u811A\u53D1\u7D27\u3002 \u5927\u6982\u770B\u51FA\u4E86\u6211\u7684\u7D27\u5F20\uFF0C\u62A4\u58EB\u9002\u65F6\u9012\u7ED9\u4E86\u6211\u4E24\u4E2A\u538B\u529B\u7403\u3002</p><p>\u5468\u533B\u751F\u544A\u8BC9\u6211\u6CBB\u7597\u65F6\u4F1A\u6709\u556A\u556A\u7684\u54CD\u58F0\uFF0C\u4F1A\u6709\u70B9\u523A\u75DB\u3002 \u7136\u540E\u6CBB\u7597\u5F00\u59CB\u4E86\uFF0C\u542C\u5230\u54CD\u58F0\u65F6\uFF0C\u9694\u7740\u773C\u7F69\u6211\u770B\u5230\u4E86\u95EA\u52A8\u7684\u7EA2\u5149\uFF0C\u771F\u7684\u662F\u6709\u70B9\u523A\u75DB\uFF0C\u6BD4\u6211\u9884\u60F3\u5F97\u66F4\u75DB\u4E00\u4E9B\uFF0C\u624B\u811A\u5FC3\u90FD\u6709\u70B9\u5192\u6C57\u4E86\uFF0C\u800C\u4E14\u4F3C\u4E4E\u80FD\u95FB\u5230\u4E00\u70B9\u86CB\u767D\u70E7\u7126\u7684\u5473\u9053\u3002 \u597D\u5728\u201C\u8001\u5E74\u6591\u201D\u9762\u79EF\u4E0D\u5927\uFF0C\u6CBB\u7597\u5F88\u5FEB\u5C31\u7ED3\u675F\u4E86\u3002</p><p>\u6CBB\u7597\u7ED3\u675F\uFF0C\u6CBB\u7597\u90E8\u4F4D\u6709\u70B9\u523A\u8FA3\u7684\u75DB\uFF0C\u62A4\u58EB\u7ED9\u4E86\u6211\u4E24\u4E2A\u5C0F\u51B0\u888B\u505A\u51B7\u6577\u3002 \u5468\u533B\u751F\u544A\u8BC9\u6211\uFF0C\u6CBB\u7597\u540E\u524D\u9762\u4E24\u5929\u5C40\u90E8\u53EF\u80FD\u4F1A\u6709\u4E9B\u7EA2\uFF0C\u989C\u8272\u8FD8\u53EF\u80FD\u4F1A\u52A0\u6DF1\uFF0C\u4F46\u8131\u75C2\u540E\u989C\u8272\u5E94\u8BE5\u80FD\u53D8\u6DE1\uFF0C\u540C\u65F6\u4EA4\u4EE3\u4E86\u6CE8\u610F\u4E8B\u9879\uFF0C\u6BD4\u5982\u6CE8\u610F\u9632\u6652\u7B49\u3002 \u540C\u65F6\u544A\u8BC9\u6211\uFF0C\u8FD9\u4E2A\u6591\u6709\u70B9\u539A\u4E86\uFF0C\u4E00\u6B21\u6CBB\u7597\u53EF\u80FD\u8FD8\u4E0D\u591F\uFF0C1-2\u6708\u540E\u53EF\u80FD\u8FD8\u9700\u8981\u505A\u4E00\u6B21\uFF0C\u8FD9\u6B21\u201C\u533B\u7F8E\u4F53\u9A8C\u201D\u5C31\u7ED3\u675F\u4E86\u3002</p><p>\u540E\u7EED\u7684\u51E0\u5929\uFF0C\u8FD9\u5757\u6591\u7684\u53D8\u5316\u4E5F\u6B63\u5982\u5468\u533B\u751F\u6240\u8BF4\uFF0C\u521A\u5F00\u59CB\u5468\u56F4\u6709\u70B9\u7EA2\uFF0C\u540E\u9762\u5C31\u53D8\u9ED1\u4E86\uFF0C\u6628\u5929\u662F\u6CBB\u7597\u540E\u7B2C4\u5929\uFF0C\u75C2\u7EC8\u4E8E\u8131\u4E86\uFF0C\u9732\u51FA\u7684\u76AE\u80A4\u5E95\u8272\uFF0C\u989C\u8272\u4E5F\u771F\u7684\u6DE1\u4E86\u5F88\u591A\u3002</p><hr><p><strong>\u6211\u5BF9\u7F8E\u5BB9\u7684\u770B\u6CD5</strong></p><p>\u8138\u7684\u5916\u5F62\u662F\u5BA2\u89C2\u7684\uFF0C\u800C\u7F8E\u662F\u4E3B\u89C2\u6027\u7684\u3002</p><p>\u4E00\u4E2A\u4EBA\u5BF9\u5916\u8C8C\u7684\u81EA\u6211\u8BC4\u5224\u548C\u63A5\u53D7\u5EA6\uFF0C\u662F\u5BB9\u6613\u53D7\u7FA4\u4F53\u610F\u89C1\u6240\u5F71\u54CD\u3002 \u7F8E\u5BB9\u7684\u672C\u8D28\uFF0C\u662F\u8BA9\u4EBA\u7684\u76AE\u80A4\u548C\u8138\uFF0C\u671D\u81EA\u5DF1\u548C\u522B\u4EBA\u6240\u8BA4\u540C\u7684\u90A3\u4E2A\u7F8E\u7684\u65B9\u5411\u8D70\uFF0C\u5C24\u5176\u662F\u8138\u3002</p><p>\u5728\u5BB9\u989C\u4E0A\uFF0C\u6211\u89C9\u5F97\u6700\u91CD\u8981\u7684\u662F\u81EA\u5DF1\u662F\u5426\u63A5\u53D7\u81EA\u5DF1\u3002 \u4E0D\u540C\u65F6\u4EE3\uFF0C\u751A\u81F3\u4E0D\u540C\u793E\u4F1A\uFF0C\u7F8E\u7684\u6807\u51C6\u4F1A\u6709\u4E0D\u540C\u3002 \u90A3\u53E5\u5BA3\u79F0\u201C\u5973\u4EBA\u7F8E\u4E86\u624D\u5B8C\u7F8E\u201D\u7684\u5E7F\u544A\u8BCD\uFF0C\u662F\u4E00\u79CD\u8D29\u5356\u7126\u8651\uFF0C\u4E3A\u8FFD\u8D76\u6F6E\u6D41\u53BB\u505A\u533B\u7F8E\u6211\u89C9\u5F97\u662F\u4E0D\u503C\u5F97\u7684\u3002 \u4E3A\u4E86\u83B7\u5F97\u66F4\u591A\u793E\u4F1A\u8BA4\u540C\uFF0C\u6216\u8005\u4E3A\u4E86\u53D6\u60A6\u81EA\u5DF1\uFF0C\u5728\u9762\u8C8C\u4E0A\u505A\u4E00\u4E9B\u6539\u53D8\uFF0C\u6211\u89C9\u5F97\u80FD\u7406\u89E3\u3002</p><p>\u5047\u5982\u628A\u8138\u6BD4\u4F5C\u5899\uFF0C\u65E5\u5E38\u517B\u62A4\uFF0C\u4E3B\u8981\u662F\u56F4\u7ED5\u6E05\u6D01\u3001\u4FDD\u6E7F\u3001\u9632\u6652\u4E09\u4EF6\u4E8B\u6765\u505A\uFF0C\u9760\u6D17\u9762\u5976+\u4FDD\u6E7F\u971C+\u9632\u6652\u971C\u57FA\u672C\u53EF\u4EE5\u89E3\u51B3\u6240\u6709\u7684\u76AE\u80A4\u5E38\u89C4\u4FDD\u517B\u95EE\u9898\u3002</p><p>\u5E38\u89C4\u4FDD\u517B\u4E4B\u5916\u7684\u5176\u5B83\u5316\u5986\u54C1\uFF0C\u66F4\u591A\u7684\u4F5C\u7528\u662F\u4E34\u65F6\u7684\u88C5\u9970\uFF0C\u6BD4\u5982\u7C89\u5E95\u3001\u773C\u5F71\u3001\u53E3\u7EA2\u7B49\u7B49\uFF0C\u5B83\u4EEC\u7684\u4F5C\u7528\u5C31\u50CF\u5899\u4E0A\u7684\u817B\u5B50\u548C\u6CB9\u5F69\u3002</p><p>\u800C\u533B\u7597\u7F8E\u5BB9\uFF0C\u5219\u66F4\u591A\u50CF\u662F\u505A\u4FEE\u7F2E\u5DE5\u7A0B\uFF0C\u5F53\u5899\u9762\u51FA\u73B0\u72B6\u51B5\uFF0C\u6BD4\u5982\u9F13\u5305\u3001\u5F00\u88C2\u3001\u8D77\u9709\u6591\uFF0C\u5219\u9700\u8981\u505A\u4E9B\u5C0F\u7684\u4FEE\u7F2E\uFF0C\u73BB\u5C3F\u9178\u3001\u8089\u6BD2\u7D20\u3001\u6FC0\u5149\u3001\u5149\u5B50\u5AE9\u80A4\u3001\u5237\u679C\u9178\u3001\u8131\u6BDB\u90FD\u662F\u9762\u90E8\u4FEE\u7F2E\u7528\u7684\u3002</p><p>\u5982\u679C\u5BF9\u5899\u7684\u5916\u89C2\u5B9E\u5728\u4E0D\u6EE1\u610F\uFF0C\u60F3\u628A\u5899\u4F53\u6539\u6389\uFF0C\u90A3\u5C31\u662F\u533B\u7597\u6574\u5F62\u624B\u672F\u4E86\uFF0C\u5B83\u80FD\u5E26\u6765\u5F88\u5927\u7684\u6539\u53D8\uFF0C\u4F46\u98CE\u9669\u4E5F\u66F4\u5927\u3002</p><p>\u6574\u4F53\u800C\u8A00\uFF0C\u5899\u7684\u57FA\u672C\u529F\u80FD\uFF0C\u4E0D\u4F1A\u56E0\u4E3A\u5899\u9762\u7684\u4E00\u4E9B\u53D8\u5316\u800C\u53D7\u5F71\u54CD\uFF0C\u4E0D\u8FC7\u5899\u9762\u4F1A\u5F71\u54CD\u89C6\u89C9\u89C2\u611F\u7684\uFF0C\u8981\u4FDD\u6301\u5899\u9762\u6574\u6D01\uFF0C\u65E5\u5E38\u7EF4\u62A4\u662F\u5173\u952E\uFF0C\u7EF4\u62A4\u4E0D\u597D\uFF0C\u5C31\u53EA\u80FD\u9760\u88C5\u9970\u4E86\uFF0C\u5982\u679C\u5899\u8001\u5316\u4E86\uFF0C\u5219\u662F\u53EF\u4EE5\u8003\u8651\u505A\u4E9B\u4FEE\u7F2E\uFF0C\u800C\u6539\u5899\u4F53\uFF0C\u5219\u53EA\u6709\u5BF9\u73B0\u5728\u7684\u5899\u5B9E\u5728\u4E0D\u6EE1\u610F\u624D\u8981\u8003\u8651\u3002</p><p>\u5728\u8FD9\u4E9B\u63AA\u65BD\u91CC\uFF0C\u6027\u4EF7\u6BD4\u6700\u9AD8\u7684\u5E94\u8BE5\u662F\u65E5\u5E38\u517B\u62A4\uFF0C\u4E5F\u5C31\u662F<strong>\u6E05\u6D01+\u4FDD\u6E7F+\u9632\u6652</strong>\uFF0C\u4F46\u5927\u90E8\u5206\u4EBA\u5728\u5E74\u8F7B\u65F6\u4E0D\u77E5\u9053\u8FD9\u4E00\u70B9\uFF0C\u4E5F\u6CA1\u6709\u8FD9\u79CD\u610F\u8BC6\uFF0C\u56E0\u4E3A\u90A3\u65F6\u76AE\u80A4\u72B6\u51B5\u5F88\u597D\uFF0C\u9664\u4E86\u505A\u65E5\u5E38\u7684\u6E05\u6D01\uFF0C\u5728\u4FDD\u6E7F\u548C\u9632\u6652\u4E0A\u662F\u4E0D\u4F1A\u7279\u522B\u53BB\u6CE8\u610F\u7684\u3002</p><p>\u76F8\u6BD4\u800C\u8A00\uFF0C\u5927\u5BB6\u5F88\u5BB9\u6613\u88AB\u90A3\u4E9B\u529F\u6548\u6027\u7684\u5316\u5986\u54C1\u5E7F\u544A\u6D17\u8111\uFF0C\u82B1\u5F88\u591A\u94B1\u53BB\u4E70\u90A3\u4E9B\u5BA3\u79F0\u6709\u7F8E\u767D\u3001\u8865\u6C34\u3001\u6297\u76B1\u3001\u6297\u8001\u5316\u7B49\u529F\u6548\u7684\u9AD8\u4EF7\u5316\u5986\u54C1\uFF0C\u4F46\u5B9E\u9645\u4E0A\u8FD9\u4E9B\u529F\u6548\u57FA\u672C\u6CA1\u4F9D\u636E\uFF0C\u4E0E\u5176\u628A\u94B1\u5728\u8FD9\u4E9B\u4EA7\u54C1\u4E0A\u7ED9\u81EA\u5DF1\u627E\u5B89\u6170\uFF0C\u5012\u8FD8\u4E0D\u5982\u7701\u4E0B\u8FD9\u4E9B\u94B1\u505A\u4E2A\u6B63\u89C4\u7684\u533B\u7F8E\u66F4\u5B9E\u5728\u3002</p><p>\u4E0A\u9762\u7684\u89C2\u70B9\u4E5F\u5F97\u5230\u4E86\u6021\u79BE\u8BCA\u6240\u7684\u4E24\u4F4D\u76AE\u80A4\u79D1\u533B\u751F\u7684\u8BA4\u540C\u3002 \u6700\u540E\uFF0C\u4E3A\u4E86\u652F\u6301\u4ED6\u4EEC\u7684\u4E1A\u52A1\uFF0C\u4E5F\u4E3A\u4E86\u6539\u5584\u4E00\u4E0B\u81EA\u5DF1\u7684\u9762\u90E8\u72B6\u51B5\uFF0C\u6211\u4E5F\u5FCD\u75DB\u529E\u4E86\u4E2A\u5149\u5B50\u5AE9\u80A4\u5957\u9910\uFF0C\u7B49\u4EE5\u540E\u505A\u4E86\u8FD9\u4E2A\u5957\u9910\uFF0C\u518D\u7ED9\u5927\u5BB6\u5206\u4EAB\u4E00\u4E0B\u81EA\u5DF1\u7684\u4F53\u9A8C\u3002</p><hr><p>\u533B\u5B66\u7F8E\u5BB9\u7684\u57FA\u7840\u662F\u533B\u5B66\uFF0C\u5728\u6B63\u786E\u8BC4\u4F30\u597D\u76AE\u80A4\u95EE\u9898\u7684\u57FA\u7840\u4E0A\uFF0C\u624D\u80FD\u505A\u51FA\u9488\u5BF9\u6027\u7684\u76AE\u80A4\u62A4\u7406\u53CA\u6CBB\u7597\u65B9\u6848\u3002</p><p>\u6021\u79BE\u7684\u533B\u5B66\u7F8E\u5BB9\uFF0C\u671F\u671B\u5411\u5927\u5BB6\u63D0\u4F9B\u7684\u662F\u53EF\u9760\u800C\u5B9E\u7528\u7684\u533B\u5B66\u7F8E\u5BB9\uFF0C\u76EE\u524D\u7684\u4E24\u4F4D\u76AE\u80A4\u79D1\u533B\u751F\u5747\u4E3A\u6BD5\u4E1A\u4E8E\u5317\u4EAC\u534F\u548C\u533B\u5B66\u9662\u7684\u76AE\u80A4\u533B\u5B66\u535A\u58EB\uFF0C\u60F3\u4F53\u9A8C\u7684\u53EF\u901A\u8FC7\u4E0B\u9762\u4E8C\u7EF4\u7801\u9884\u7EA6<strong>\u5218\u6392</strong>\u548C<strong>\u5468\u7490</strong>\u533B\u751F\u7684\u95E8\u8BCA,\u70B9\u9605\u8BFB\u539F\u6587\u53EF\u4E86\u89E3\u76EE\u524D\u7684\u533B\u7F8E\u670D\u52A1\u3002</p>',31),h={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=2651628998&idx=1&sn=4bb66908dc015e0b1454ab1b2c8e6285&chksm=8b5c8c3cbc2b052a2916c4c6d2f96d499d523e86c3702951bcfc862ca6ac5c1e736ea8c3a267&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},l=s("\u67E5\u770B\u539F\u6587");function b(m,f){const e=a("ExternalLinkIcon");return r(),c(n,null,[_,p("p",null,[p("a",h,[l,t(e)])])],64)}var u=i(d,[["render",b]]);export{u as default};
